import { Box, FormControl, MenuItem, Select } from '@mui/material';
import '../../../LoginPage.scss';

const styled = { fontFamily: 'SVN-Sofia-Regular' };
interface Props {
  defaultOption: string;
  objectOption: string[];
}

function Selected({ defaultOption, objectOption }: Props) {
  return (
    <Box sx={{ minWidth: 120 }}>
      <FormControl fullWidth>
        <Select
          defaultValue=""
          // onChange={handleChange}
          inputProps={{ 'aria-label': 'Without label' }}
          style={{ background: '#f1f3f5' }}
          displayEmpty
          className="ip"
        >
          <MenuItem value="" id="menu-item-1" disabled>
            <em
              style={{
                fontSize: '16px',
                fontFamily: 'SVN-Sofia-Regular',
                fontStyle: 'normal',
                color: 'rgb(104, 112, 118)',
              }}
            >
              {defaultOption}
            </em>
          </MenuItem>
          {objectOption.map((option: string, index: number) => (
            <MenuItem key={index} style={styled} className="menu-item" value={index}>
              {option}
            </MenuItem>
          ))}
          {/* <MenuItem value="" id="menu-item-1" disabled>
            <em
              style={{
                fontSize: '16px',
                fontFamily: 'SVN-Sofia-Regular',
                fontStyle: 'normal',
                color: 'rgb(104, 112, 118)',
              }}
            >
              Choose Gender
            </em>
          </MenuItem>
          <MenuItem style={styled} className="menu-item" value={1}>
            Male
          </MenuItem>
          <MenuItem style={styled} className="menu-item" value={2}>
            Female
          </MenuItem> */}
        </Select>
      </FormControl>
    </Box>
  );
}

export default Selected;
